"135597":{"id":"135597","name":"Fairfax","slug":"fairfax","original_title":"Fairfax","overview":"Série animada centrada em quatro amigos do ensino médio em sua busca pela fama na Fairfax Avenue, em Los Angeles.","first_air_date":"2021-10-29","episode_run_time":0,"vote_average":5,"number_of_seasons":2,"number_of_episodes":16,"created_by":["Matt Hausfater","Aaron Buchsbaum","Teddy Riley"],"production_companies":["Titmouse","Serious Business"],"genres":["Comédia","Animação"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/1IVTdSgLtx4tFrEmpmAfhy746Fk.jpg","poster_path":"https://image.tmdb.org/t/p/original/oOEFB2yTmaDOoYsybgxJw7lz8UW.jpg","cast":[],"trailer":"vYhlAp4H3A8","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/oOEFB2yTmaDOoYsybgxJw7lz8UW.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/oOEFB2yTmaDOoYsybgxJw7lz8UW.jpg","air_date":"2021-10-29","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A camiseta box do Doutor Phil","overview":"Dale, um garoto de treze anos e sua família mudam-se para Fairfax, onde ele recebe as boas-vindas de Derica, Benny e Truman enquanto tentam conseguir o mais novo lançamento da Latrine: A camiseta box do Doutor Phil.","air_date":"2021-10-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/e1L820cNMiENctzkcclnQQgzZAT.jpg","vote_average":0},"2":{"name":"Dale @bigpeens bombando na internet","overview":"Quando Melody resolve dar uma festa na piscina para comemorar que sua conta do Instagram foi verificada, Truman decide ajudar Dale a ganhar os cem seguidores necessários para entrar na festa, enquanto Derica coloca Benny para fazer uma \"dericaeróbica\".","air_date":"2021-10-29","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/2O41gskD7yKgiUOS2TkTAnHeI24.jpg","vote_average":0},"3":{"name":"Aloprando no asilo","overview":"Locke encontra um alçapão e Sawyer descobre que... Opa, desenho errado. É dia de passeio! A galerinha da Fairfax visita um lar para idosos!!","air_date":"2021-10-29","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/vmAsN94rAkFpfSxJkDFgm3QD2Mt.jpg","vote_average":0},"4":{"name":"Dale odeia o pai","overview":"A internet faz Dale questionar seu amor pelo pai; enquanto isso, Derica encontra uma baleia orca dentro do Rio Los Angeles. Que loucura é essa?!","air_date":"2021-10-29","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/lrM5ByUMHbFtP6iJfncByaxrPvX.jpg","vote_average":0},"5":{"name":"O Festival Chernobyl","overview":"A galerinha vai ao Festival Chernobyl, um festival de música, poluição e radiação, organizado por Young Poluidor e a Gangue poluidora.","air_date":"2021-10-29","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/mbsYVgj5bpZHsvt821kgbAfCGM9.jpg","vote_average":0},"6":{"name":"E-esporte e eleição. É cheiro de treta, irmão","overview":"Don trai Betty... Puts, desenho errado outra vez! Benny tenta entrar para o time de E-esportes da escola, enquanto Truman descobre as dificuldades do cinema cotidiano. Ao mesmo tempo, Derica vira coordenadora de campanha do Dale enquanto ele disputa a eleição para ser o Amigo da Galera.","air_date":"2021-10-29","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/e93hbtIbNcG4hdtWAODNnPZdhS.jpg","vote_average":0},"7":{"name":"Em busca do Dorito dourado","overview":"Benny está na igreja com sua família quando a Latrine anuncia o maior lançamento do ano, o Dorito Dourado. Desfalcada de um integrante, a galerinha parte em uma saga épica para encontrar o Dorito que pode mudar a vida deles para sempre.","air_date":"2021-10-29","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/wRUAOVUZcAi60C0Rsa6okyvwCjd.jpg","vote_average":0},"8":{"name":"Aloprando no covil do Hiroki","overview":"Após encontrar o Dorito Dourado, nosso quarteto fantástico finalmente vai conhecer o covil de seu grande herói.","air_date":"2021-10-29","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/i7GlKWtq7yXlh5sD6DtZCWjmJc9.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/8DIwqALKmSoU2Wv7vjs0sLOnjPp.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8DIwqALKmSoU2Wv7vjs0sLOnjPp.jpg","air_date":"2022-06-09","episode_count":8,"overview":"N/A","vote_average":7.5,"episodes":{"1":{"name":"Uma Noite em Fairfax","overview":"Quando a mais nova grife fashion de Fairfax, a Du-Brian, lança o tênis bola de tênis, a galerinha resolve acampar na fila no meio da noite.","air_date":"2022-06-09","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/bzASY0KJKIhxJgqr1Itby0zTHje.jpg","vote_average":7},"2":{"name":"O Funeral do Diretor Weston","overview":"Após a notícia de que o Diretor Weston bateu as botas se espalhar, os alunos da Escola Secundária Fairfax começam a competir pra ver quem sente mais luto.","air_date":"2022-06-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/trOThe8Gmf6jRh1DwGftNLmV94p.jpg","vote_average":8},"3":{"name":"O Círculo do Hype","overview":"A área do Avron tá sendo ameaçada... Putz! Digo, a galerinha apresenta o Dale ao místico ecossistema que é a Feira Livre de Fairfax. O Benny fica preso no lado da sombra, o Truman entra pra banda de mães da Trini, e a Derica encontra a jaqueta perfeita.","air_date":"2022-06-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/8oW68N59kSNBKrThKNKmaauDubH.jpg","vote_average":7},"4":{"name":"A Feira de Profissões","overview":"O emprego do treinador Taylor tá por um fio pois o time da cidade... Ai caramba. Qual é a série mesmo? Fairfax? Show de bola. É o dia da Feira de Porfissões! Derica se aproveita de uma rápida ascenção na Girlbossier só pra descobrir que o sonho de ser uma modelo ativista pode ser um pesadelo. E o Truman se reconecta com uma antiga paixão.","air_date":"2022-06-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/uGzORI0XTAfnFIPdHNlQOo9v6QT.jpg","vote_average":8},"5":{"name":"Pegando Fogo","overview":"Uma injustamente acusada Derica vai parar na detenção e acaba conseguindo provar sua inocência enquanto faz novas amizades bastante improváveis. Enquanto isso, Truman arrisca todo seu legado de diretor em busca de gravar o vídeo de segurança contra incêndio mais seguro e quente de todos.","air_date":"2022-06-09","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/rbWR5qtDFOVvxrsZ55D3fsL4r7S.jpg","vote_average":7},"6":{"name":"O Resgate","overview":"O dia de sol na praia que o Dale tanto sonha vai ter que ser adiado porque a galerinha vai tentar resgatar o Hiroki da infame Clout 9.","air_date":"2022-06-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/vXMp1chUsw84dxI3WHbotiJlhwt.jpg","vote_average":7},"7":{"name":"O Grande Baile da Escola","overview":"Walt e Jesse estão muito furiosos com o Gus. Enquanto isso, a galerinha parte pro baile da escola! E o Truman rouba a cena com a sua acompanhante.","air_date":"2022-06-09","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/AYLULxxvq6odJp7KbwIOmjmHZr.jpg","vote_average":8},"8":{"name":"Guerra Fashion","overview":"Último episódio da temporada! Nada de spoiler aqui.","air_date":"2022-06-09","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/5KvU3MQEtXpFToBgVpaUFjpjBRY.jpg","vote_average":8}}}}},
