"110126":{"id":"110126","name":"Agente Elvis","slug":"agente-elvis","original_title":"Agent Elvis","overview":"Elvis entra para um programa secreto do governo americano e troca o rock pela espionagem para combater forças sombrias que ameaçam os EUA.","first_air_date":"2023-03-17","episode_run_time":0,"vote_average":6.612,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Priscilla Presley","John Eddie"],"production_companies":["Authentic Brands Group","Sony Pictures Animation","Titmouse"],"genres":["Animação","Comédia","Action & Adventure"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/gEQbPVIhN7HAe7VbH58BNVbX0NH.jpg","poster_path":"https://image.tmdb.org/t/p/original/12Tdb1rbxZ0DQBkXu3weTb8UtnD.jpg","cast":["Matthew McConaughey","Kaitlin Olson","Johnny Knoxville","Niecy Nash-Betts","Tom Kenny"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9iFMG4zyAkLnvfEwNqIiiEEQ342.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9iFMG4zyAkLnvfEwNqIiiEEQ342.jpg","air_date":"2023-03-17","episode_count":10,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"O retorno","overview":"Enquanto se prepara para sua volta triunfal, Elvis vira alvo da família Manson, e uma organização secreta tenta recrutá-lo para sua equipe.","air_date":"2023-03-17","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/ltfGjELQlqwYmSZA4Mm0sA5sjxj.jpg","vote_average":7.3},"2":{"name":"Vegas que se foda","overview":"Elvis retorna a Vegas e encontra Howard Hughes, uma gangue de espiões malvados e um avião nuclear. Bertie lida com o comportamento irresponsável de Scatter.","air_date":"2023-03-17","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/5Q4pqf8g31WD3UzH9skPlEfKJCR.jpg","vote_average":6.8},"3":{"name":"Terça da cocaína","overview":"Durante as filmagens de \"Ele e as Três Noviças\", e inspirado pelo pouso na Lua, Elvis tenta impedir uma operação de tráfico de drogas, apesar das objeções de CeCe.","air_date":"2023-03-17","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/cgL9ALDKGWWrZIbAiGw5yHwIX93.jpg","vote_average":8},"4":{"name":"Delírio total","overview":"Elvis recebe treinamento prático: o Comandante o coloca em sua primeira missão no OGC para encontrar uma possível arma em um grande festival.","air_date":"2023-03-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lnd0OQQIkVu4uCk8anSy6XvESGa.jpg","vote_average":6.8},"5":{"name":"Densidade máxima","overview":"Elvis, CeCe, Bobby Ray e Scatter vão para Washington com a missão de interceptar um arquivo que pode revelar ao Presidente Nixon a existência do OGC.","air_date":"2023-03-17","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/3TYmmvajGwrQKGHW4uT47UKdGBz.jpg","vote_average":6.8},"6":{"name":"Ursinha","overview":"Antes de uma apresentação para as tropas no Vietnã, Elvis e CeCe se encontram com uma pessoa inesperada. Eles investigam o uso de uma arma que controla a mente.","air_date":"2023-03-17","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/t5zzdnSbjlaTKZoINerbaMB5Ow5.jpg","vote_average":7},"7":{"name":"Menta do Magrebe","overview":"Timothy Leary, famoso defensor do uso de drogas psicodélicas, foge da prisão, e Elvis e CeCe vão para a Argélia atrás dele, onde o Comandante tenta conquistar Bertie.","air_date":"2023-03-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8MfYDCGkJr3BdMobb8PBWv8RqL3.jpg","vote_average":6.5},"8":{"name":"Derretendo o cérebro","overview":"Durante uma convenção de fãs de Elvis no hotel The Peabody Memphis, o cantor vive uma experiência alucinógena graças ao professor Leary.","air_date":"2023-03-17","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/qxITfOR1auqX1ZDKnz5dHlmEJRp.jpg","vote_average":6.8},"9":{"name":"Desejo ardente","overview":"Bertie se encarrega de distrair o Comandante, enquanto Elvis tenta descobrir o que é o Projeto Tupelo – e por que ele vive tendo flashbacks sobre isso.","air_date":"2023-03-17","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/5gvZE8kbwfPQBteE055xm7uYTVJ.jpg","vote_average":8},"10":{"name":"Boa sorte, macaquinho","overview":"Elvis tenta impedir que a arma de controle mental estrague seu show \"Aloha from Hawaii Via Satellite\", e Scatter, chapado, é lançado ao espaço em um foguete.","air_date":"2023-03-17","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/p28CeJLZs4wDBEiTbpkzz3Qugya.jpg","vote_average":7.2}}}}},
