"195352":{"id":"195352","name":"Pinha e Pony","slug":"pinha-e-pony","original_title":"Pinecone & Pony","overview":"Como uma guerreira em treinamento, Pinha não teme nenhum desafio. Felizmente, Pony garante que Pinha não se meta em muita encrenca. Juntos, eles aprendem que a vida pode ser uma aventura repleta de diversão.","first_air_date":"2022-04-08","episode_run_time":23,"vote_average":4.3,"number_of_seasons":2,"number_of_episodes":16,"created_by":["Kate Beaton","Stephanie Kaliner"],"production_companies":["DreamWorks Animation Television","First Generation Films","Atomic Cartoons"],"genres":["Animação","Família","Kids"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/9smisBYN8ObcdNvUOpM6CUs4Dba.jpg","poster_path":"https://image.tmdb.org/t/p/original/6DmTnKAtHXHqaT7r5VIsyaHhZAY.jpg","cast":["Maria Nash","Andy Hull","Chase W. Dillon","Rachel House","Viola Abley"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/6DmTnKAtHXHqaT7r5VIsyaHhZAY.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/6DmTnKAtHXHqaT7r5VIsyaHhZAY.jpg","air_date":"2022-04-08","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O pônei mais fofinho / Vem pra minha turma","overview":"Pony quer entrar em uma competição de fofura, e Pinha encara isso como uma verdadeira guerreira. Pinha leva a conjuração do arco-íris para o próximo nível.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/aEovx2ukuoRtDq2R9BGU1OeMLZn.jpg","vote_average":0},"2":{"name":"Lança ou não / Dia de mimar seu pet","overview":"Pinha, acidentalmente, quebra a lança de sua mãe e tenta consertá-la em vez de confessar. A natureza competitiva de Pinha toma conta do dia especial de Pony.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/skPI0n2RxsmE8SpRi1iDwu52oOY.jpg","vote_average":0},"3":{"name":"Onde estais, oh, Espinhoso? / Grandes desafios no pequeno labirinto","overview":"Manter sua pelúcia em segredo cria um problema para Pinha. Os guerreirinhos aprendem que suas habilidades cotidianas podem ser tão poderosas quanto suas habilidades de guerreiros.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/9RX10SQCKM42ikJTJI3YlVOHGAu.jpg","vote_average":0},"4":{"name":"Isso requer coragem / A flecha do bom caminho","overview":"Pinha se recusa a pedir ajuda durante a sua primeira missão solo com Pony. Pinha conhece seu ídolo de arco e flecha, mas ele não é o que ela esperava.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/t6F9vuLmBiuhuBtqi6VCtO0Q21l.jpg","vote_average":0},"5":{"name":"É coisa de Pony / Hawthorn, o aventureiro","overview":"Pinha, bem-intencionada, afasta Pony de seus deveres de cuidador de casulo. Pinha ajuda Hawthorn a se preparar para sua aventura da turma mágica.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/7nxmkXDIJnP75oFUC90ZXkYFVxp.jpg","vote_average":0},"6":{"name":"Na nossa cara / Cinto ou farsa","overview":"Pinha está muito distraída para ajudar a Fauna a cuidar de uma planta especial. Um comerciante vende cinturões novos às crianças em troca de seus bens preciosos.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/sTMq0dxGYM3F0OlfB3ZLE6YU5uX.jpg","vote_average":0},"7":{"name":"Manda ver! / O Expresso Pony","overview":"A noite de jogo em família revela um lado incomum de Kimya que Pinha nunca viu. Um ímpio de madeira gera problemas para Pinha e Annabelle.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/gqkHWvQ3QnqtW2ndtSG6mHpnek0.jpg","vote_average":0},"8":{"name":"O que Freda faria? / Insígnia de força","overview":"Pinha insiste que sua canção Freda, a Feroz, é perfeita do jeito que é. Uma busca para provar sua força coloca Pinha cara a cara com um dragão.","air_date":"2022-04-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/qqu9FN4gI0rxBfSyKtZJ4lak4lv.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/a9efgedzBKvwlStH2g3cxHkZYCm.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/a9efgedzBKvwlStH2g3cxHkZYCm.jpg","air_date":"2023-02-02","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Sopa de herói / Insônia na festa do pijama","overview":"Pinha tenta fazer um lendário presente para Gladys. Hawthorn treina com seu pai para ampliar suas habilidades de festa do pijama.","air_date":"2023-02-02","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/fDSKjormMyJtWpPWgJXeHXfVoG5.jpg","vote_average":0},"2":{"name":"O espírito da colheita / Fale de arte","overview":"Pony, Pinha e Hawthorn partiram para descobrir a verdade por trás de uma lenda de Pedraforte. Pinha dá a Annabelle uma nova perspectiva sobre a família.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/g2OEHnCfmNxmmqWvhsOgoxPuS8Y.jpg","vote_average":0},"3":{"name":"Apenas por uma noite / Fonte da junventude","overview":"Pinha fará o que for preciso para assistir a seus shows favoritos. Hawthorn e Pinha conhecem um garoto que não sabe o que quer ser.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/yIE8oyDb9ivitHib8AH9S0NwSuT.jpg","vote_average":0},"4":{"name":"Boa noite, péssima noite / Uma vida de aventura","overview":"A Cavaleira da Noite visita Pinha em seus sonhos. Seguir Gladys por aí mostra a Pinha que há mais em sua mentora do que ela pensava.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/oY1DnPqFaV1nLiG8qWdCTr5qWVg.jpg","vote_average":0},"5":{"name":"Pinha e Cavalo / Uma vez em uma lua-violeta","overview":"Magpie amaldiçoa Pinha e Pony em uma vida alternativa. O feitiço de Hawthorn para reparar uma velha amizade sai pela culatra.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/7pr9JHd7tH4SgkRDT3icINQeE2M.jpg","vote_average":0},"6":{"name":"O festival do poder / Conselho sábio","overview":"Como Guardiões do Cristal para o festival deste ano, Pedraforte deve receber o príncipe Randolf. Pinha e Pony encontram um gigante.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/8OEXCO8RkmIV7DfZFRLb72M1xrr.jpg","vote_average":0},"7":{"name":"O próximo da fila / Um feitiço só seu","overview":"Pinha abre um estande de ajuda que só leva a mais problemas. O torneio de esgrima mágica ensina a Hawthorn que não há problema em falhar às vezes.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/bVTQ2tOwerR3cNN7gQ1c5X5mZDa.jpg","vote_average":0},"8":{"name":"A pedra forte","overview":"Quando um monstro de pedra ameaça destruir Pedraforte, Pinha tenta proteger a cidade.","air_date":"2023-02-03","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/ywrkNER2q7XEGrXgjvMO2R37pMi.jpg","vote_average":0}}}}},
