"1130":{"id":"1130","name":"O Surfista Prateado","slug":"o-surfista-prateado","original_title":"Silver Surfer","overview":"As aventuras do viajante cósmico enquanto busca seu lar perdido após se rebelar contra seu mestre.","first_air_date":"1998-02-07","episode_run_time":0,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":13,"created_by":["Larry Brody"],"production_companies":["Saban Entertainment","Marvel Studios","Marvel Entertainment Group"],"genres":["Animação","Action & Adventure","Sci-Fi & Fantasy","Kids"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/jTupUx9wdoIKe8BFoP5Z1xzEtno.jpg","poster_path":"https://image.tmdb.org/t/p/original/lhkt2MQhyoh2eLl71hewOjxMWKn.jpg","cast":["Paul Essiembre"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lhkt2MQhyoh2eLl71hewOjxMWKn.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lhkt2MQhyoh2eLl71hewOjxMWKn.jpg","air_date":"1998-02-07","episode_count":13,"overview":"N/A","vote_average":7.7,"episodes":{"1":{"name":"A Origem do Surfista Prateado - Parte 1","overview":"O devorador de planetas Galactus tem como alvo o planeta Zenn-La, planejando consumir sua energia e assim destruí-lo. Norrin Radd se sacrifica para se tornar o arauto de Galactus, o Surfista Prateado.","air_date":"1998-02-07","runtime":21,"still_path":"https://image.tmdb.org/t/p/original/dQW5JJSCuGOvzaY7bQBBA54PcIo.jpg","vote_average":7.8},"2":{"name":"A Origem do Surfista Prateado - Parte 2","overview":"O Surfista perdeu todas as memórias que tinha como Norrin Radd. Ele agora simplesmente encontra mundo após mundo para Galactus comer, mas começa a entender que isso não está certo.","air_date":"1998-02-14","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/sQGoAGaPtVyWS02HRhHWmKKo2F5.jpg","vote_average":8},"3":{"name":"A Origem do Surfista Prateado - Parte 3","overview":"Quando Galactus tem como alvo a Terra como seu próximo mundo a devorar, o Surfista finalmente se cansou da destruição de Galactus e decide se rebelar contra seu mestre.","air_date":"1998-02-21","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/jP3YTf6N7JozYJkBYLlCMz2nW4t.jpg","vote_average":8},"4":{"name":"O Planeta do Dr. Moreau","overview":"O Surfista procura uma colônia Kree, onde dizem que vive um estudioso de Zenn-La. O Surfista é escravizado pelos Kree e forçado a trabalhar ao lado de criaturas geneticamente modificadas, conhecidas como \"Trolls\". Juntamente com o troll Pip e Kili, sua namorada, o Surfista lidera uma revolta contra os escravos Kree.","air_date":"1998-02-28","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/dV2MN3tF5khUKOBRzBmrQeiBM7Y.jpg","vote_average":7.3},"5":{"name":"Curva de Aprendizado - Parte 1","overview":"O Surfista, Pip, o Troll, Mentor e Drax, o Destruidor tentam encontrar a Biblioteca Universal.","air_date":"1998-03-07","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/xYGzCwwVKwjgU4teW8XpWp7u49i.jpg","vote_average":7.7},"6":{"name":"Curva de Aprendizado - Parte 2","overview":"Surfista deve decidir se, para obter todo o conhecimento do universo, vale a pena abrir mão de sua humanidade e liberdade.","air_date":"1998-03-14","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/6LswiR1D0H0LkK7Rn8ZNV9vQ6ul.jpg","vote_average":7.7},"7":{"name":"Visões Interiores","overview":"Surfista encontra uma série de planetas devastados por Thanos.","air_date":"1998-04-04","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/sXUTd0HRMoaBL9boxiEOvKjySdg.jpg","vote_average":7.7},"8":{"name":"Anticorpo","overview":"Galactus está morrendo e Nova recorre à ajuda do Surfista para salvá-lo.","air_date":"1998-04-11","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/7xDAeEfGD5QZrvKvraOKAjMaeEc.jpg","vote_average":7.7},"9":{"name":"Segunda Fundação","overview":"Nova fica dividida entre seus deveres com Galactus e sua lealdade ao Surfista. Ela, então, o ajuda a tentar encontrar Zenn-La.","air_date":"1998-04-25","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/I7Pog6IgpVtjIr0iNKwFnlhB6D.jpg","vote_average":7.7},"10":{"name":"Justiça Radical","overview":"O Surfista é capturado por Lorde Glenn e os Errantes e é levado a julgamento pelos crimes de Galactus. Os poderes do Surfista são retirados, e ele se transforma novamente em Norrin Radd. Enquanto ele luta para sobreviver em um planetoide cheio de armadilhas robóticas, umas estrelas gêmeas perto do planetoide começam a desmoronar e formam um buraco negro. Norrin Radd deve recuperar seus poderes como Surfista Prateado para salvar aqueles que o condenaram à morte.","air_date":"1998-05-02","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/ur58ebgcFuLQspzirBZMWalHPoa.jpg","vote_average":7.7},"11":{"name":"De Volta a Zenn-La","overview":"O Surfista finalmente encontra Zenn-La e se reúne com sua amada Shalla Bal.","air_date":"1998-05-09","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/2d0pFUR8OWJvi4oIfsg8Udh4nep.jpg","vote_average":7.7},"12":{"name":"O Fim da Eternidade","overview":"Surfista é convocado por Eternidade e Infinito e avisado que Thanos encontrou uma maneira de fazer o tempo voltar, causando o fim do universo.","air_date":"1998-05-16","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/be2Ki79hVsZvIAIl4XBfCRNyOju.jpg","vote_average":7.7},"13":{"name":"A Guerra Eterna","overview":"Surfista pede à Inteligência Suprema de Kree para ajudá-lo a encontrar Zenn-La; Adam Warlock encontram-se em uma batalha interminável com os Kree.","air_date":"1998-05-29","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/t7EibxmMU5XMDvuhThEyy5QcXo4.jpg","vote_average":7.7}}}}},
